import axios from "axios";


const instance = axios.create({
    withCredentials: true,
    baseURL: 'emphasoft-test-assignment.herokuapp.com/'
});


export const authAPI = {
    login(username, password){
        return instance.post('api-token-auth', {username, password}).then(res => res).catch(() => console.log('Error'));
    }
}
